import { useState, useEffect } from "react";
import { motion } from "framer-motion";
import { CalendarDays, Clock } from "lucide-react";

export default function Booking() {
  const [form, setForm] = useState({
    nume: "",
    prenume: "",
    telefon: "",
    service: "",
    date: "",
    time: "",
  });

  useEffect(() => {
    const user = JSON.parse(localStorage.getItem("loggedUser"));
    if (user) {
      setForm((prev) => ({
        ...prev,
        nume: user.nume || "",
        prenume: user.prenume || "",
        telefon: user.telefon || "",
      }));
    }
  }, []);

  const handleChange = (e) => setForm({ ...form, [e.target.name]: e.target.value });

  const handleSubmit = (e) => {
    e.preventDefault();
    const bookings = JSON.parse(localStorage.getItem("bookings") || "[]");
    bookings.push(form);
    localStorage.setItem("bookings", JSON.stringify(bookings));
    alert("âœ… Programarea a fost Ã®nregistratÄƒ cu succes!");
    setForm((prev) => ({ ...prev, service: "", date: "", time: "" }));
  };

  return (
    <section className="min-h-screen flex items-center justify-center bg-[#0f0f0f] text-white">
      <motion.div
        initial={{ opacity: 0, y: 40 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.6 }}
        className="bg-black/50 backdrop-blur-md border border-[#d4af37]/40 rounded-2xl p-10 w-full max-w-md shadow-lg"
      >
        <h2 className="text-3xl font-bold text-center text-[#d4af37] mb-6">
          ProgrameazÄƒ-te la tuns
        </h2>

        <form onSubmit={handleSubmit} className="space-y-6">
          {/* ðŸ”’ cÃ¢mpuri preluate din profil, doar citire */}
          <input
            type="text"
            name="nume"
            value={form.nume}
            disabled
            className="w-full bg-[#1a1a1a] border border-[#d4af37]/40 rounded-md px-4 py-2 text-gray-300 cursor-not-allowed"
            placeholder="Nume (familie)"
          />
          <input
            type="text"
            name="prenume"
            value={form.prenume}
            disabled
            className="w-full bg-[#1a1a1a] border border-[#d4af37]/40 rounded-md px-4 py-2 text-gray-300 cursor-not-allowed"
            placeholder="Prenume (nume mic)"
          />
          <input
            type="tel"
            name="telefon"
            value={form.telefon}
            disabled
            className="w-full bg-[#1a1a1a] border border-[#d4af37]/40 rounded-md px-4 py-2 text-gray-300 cursor-not-allowed"
            placeholder="NumÄƒr de telefon"
          />

          {/* ðŸ§´ select servicii */}
          <select
            name="service"
            value={form.service}
            onChange={handleChange}
            className="w-full bg-[#1a1a1a] border border-[#d4af37]/40 rounded-md px-4 py-2 text-gray-200 focus:outline-none focus:border-[#d4af37] hover:border-[#d4af37] transition"
            required
          >
            <option value="" className="text-gray-400">â€” selecteazÄƒ serviciul â€”</option>
            <option value="Tuns" className="bg-[#1a1a1a] text-[#d4af37]">Tuns</option>
            <option value="Tuns + BarbÄƒ" className="bg-[#1a1a1a] text-[#d4af37]">Tuns + BarbÄƒ</option>
            <option value="BarbÄƒ" className="bg-[#1a1a1a] text-[#d4af37]">BarbÄƒ</option>
            <option value="SpÄƒlat + Coafat" className="bg-[#1a1a1a] text-[#d4af37]">SpÄƒlat + Coafat</option>
          </select>

          {/* ðŸ•“ data + ora */}
          <div className="flex gap-3">
            <div className="relative flex-1">
              <CalendarDays className="absolute left-3 top-2.5 text-[#d4af37] w-5 h-5" />
              <input
                type="date"
                name="date"
                value={form.date}
                onChange={handleChange}
                className="w-full bg-[#1a1a1a] border border-[#d4af37]/40 rounded-md px-10 py-2 text-gray-200 focus:border-[#d4af37] transition"
                required
              />
            </div>

            <div className="relative flex-1">
              <Clock className="absolute left-3 top-2.5 text-[#d4af37] w-5 h-5" />
              <input
                type="time"
                name="time"
                value={form.time}
                onChange={handleChange}
                className="w-full bg-[#1a1a1a] border border-[#d4af37]/40 rounded-md px-10 py-2 text-gray-200 focus:border-[#d4af37] transition"
                required
              />
            </div>
          </div>

          {/* buton */}
          <motion.button
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
            type="submit"
            className="w-full mt-4 bg-[#d4af37] text-black font-semibold py-3 rounded-md hover:bg-transparent hover:text-[#d4af37] border border-[#d4af37] transition"
          >
            ProgrameazÄƒ-te acum
          </motion.button>
        </form>
      </motion.div>
    </section>
  );
}
